import React from "react";
import { useSpring, animated } from 'react-spring';

function AboutMe () {
const div1 = useSpring({
    delay: 2000,
    to: {opacity: 1, transform: "scale(1) translateY(0)"}, 
    from: { opacity: 0, transform: "scale(0.75) translateY(5px)"} 
})
const div2 = useSpring({
    delay: 2500,
    to: {opacity: 1, transform: "scale(1) translateY(0)"}, 
    from: { opacity: 0, transform: "scale(0.75) translateY(5px)"} 
})
const div3 = useSpring({
    delay: 3000,
    to: {opacity: 1, transform: "scale(1) translateY(0)"}, 
    from: { opacity: 0, transform: "scale(0.75) translateY(5px)"} 
})


return(
    <main className="grid-container fluid AboutMe">
        <div className="grid-x grid-margin-x align-center-middle">
            <animated.div style={div1} className="cell small-12 medium-4 large-4 Kiel">
                Full Stack Developer
            </animated.div>
            <animated.div style={div2}className="cell small-12 medium-4 large-4 Kiel">
                Husband
            </animated.div>
            <div className="cell small-12 medium-4 large-4 Kiel">
                Veteran
            </div>
            <animated.div style={div3} className="cell small-12 medium-4 large-4 Kiel">
                Brother
            </animated.div>
            <div className="cell small-12 medium-4 large-4 Kiel">
                Artist
            </div>
            <div className="cell small-12 medium-4 large-4 Kiel">
                Uncle
            </div>
        </div>
        <div className="grid-x grid-margin-x align-center-middle">
            <div className="cell small-12 medium-4 large-4 Kiel self" style={{textAlign: "end", color: "#222", fontSize: "1.75em", paddingRight: "5px" }}>
                Jonathan & Kiel
            </div>
            <div className="cell small-12 medium-2 large-2 Kiel odin" style={{textAlign: "end", color: "#222", fontSize: "1.75em", paddingRight: "5px" }}>
                Odin
            </div>
        </div>
    </main>
);
}

export default AboutMe;
